 import {Link} from 'react-router-dom';

const Navigation = () => {
  return (
    <>
        <div className='navbar flex space-between'>
            <img className='logo h-8' src='../images/logo.png'></img>

            <ul>
            <Link to="/">HOME</Link>
            <Link to="/about">ABOUT</Link>
            </ul>

        </div>
    </>
  )
}

export default Navigation
